from collections import Counter

def isValidString(s):
    if len(s) <= 6:
        return False
    cnt = Counter(s)
    for i in range(len(s) - 5):
        if len(set(s[i:i + 6])) != 6:
            return False
        for key in cnt.keys():
            if cnt[key] % 2 != 0:
                return False
    frequency_counter = Counter(cnt.values())
    for value in frequency_counter.values():
        if value > 3:
            return False
    return True

